import React, { useState } from 'react'
import axios from 'axios'
import { useNavigate } from 'react-router-dom'

const Login = () => {
    const [username, setUserName] = useState("");
    const [password, setPassword] = useState("");

    const navigate = useNavigate();

    const handleNameChange = (value) => {
        setUserName(value);
    }

    const handlePasswordChange = (value) => {
        setPassword(value);
    }

    const handleSubmit = () => {
        const data = {
            username : username,
            password : password
        }
        const url = 'https://localhost:7186/api/Logins';
            axios.post(url,data).then((result) => {
                navigate('/home');
            }).catch((error) => {
                if (error.response) {
                    // The request was made and the server responded with a status code
                    // that falls out of the range of 2xx
                    console.error('Server Error Response:', error.response.data);
                    alert('Server Error: ' + error.response.data.Error); // Display the error to the user
                } else if (error.request) {
                    // The request was made but no response was received
                    console.error('No Response Received:', error.request);
                    alert('No Response Received. Please try again.'); // Display a generic error
                } else {
                    // Something happened in setting up the request that triggered an Error
                    console.error('Request Setup Error:', error.message);
                    alert('Request Setup Error. Please try again.'); // Display a generic error
                }
            });
    }

    return (
        <div>
            <div>
                <form onSubmit={handleSubmit}>
                    <div class="mb-3 mt-3 ">
                        <input type="text" class="form-control" id="username" placeholder="Enter username" onChange={(e) => handleNameChange(e.target.value)} name="username" />
                        <input type="text" class="form-control" id="password" placeholder="Enter password" onChange={(e) => handlePasswordChange(e.target.validationMessage)} name="password" />
                    </div>
                    <div>
                        <button className='btn btn-success'>Login</button>
                    </div>
                </form>
            </div>
        </div>
    )
}

export default Login
